CREATE TABLE `lesmille_tech` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `type` varchar(64) DEFAULT NULL COMMENT '动作分类',
  `name` varchar(64) DEFAULT NULL COMMENT '动作',
  `name_en` varchar(128) DEFAULT NULL COMMENT '英文名',
  `target` varchar(64) DEFAULT NULL COMMENT '目标肌肉',
  `position` varchar(1024) DEFAULT NULL COMMENT '姿势建立',
  `execution` varchar(512) DEFAULT NULL COMMENT '执行建立',
  `layer2` varchar(512) DEFAULT NULL COMMENT '第二层教授',
  `img_list` text COMMENT '动作图片',
