-- ----------------------------
--  Records of `lesmille_tech`
-- ----------------------------
BEGIN;
INSERT INTO `lesmille_tech` VALUES ('1', '1', '基本站姿', 'SET POSITION', null, '<p>&bull; 脚跟位于髋关节正下方</p>\r\n\r\n<p>&bull; 脚趾微微向外打开 &bull; 放松膝盖</p>\r\n\r\n<p>&bull; 双手与大腿间距拇指宽</p>\r\n\r\n<p>&bull; 轻轻收腹并绷紧腹部</p>\r\n\r\n<p>&bull; 挺胸</p>\r\n\r\n<p>&bull; 肩膀向上，绕肩向后，将肩胛骨收紧下拉至脊柱</p>\r\n\r\n<p>&bull; 收下巴</p>', null, null, '[\"images\\/60bca336cc39e4c42833800bcfe44cdf.png\"]', '2018-08-22 16:53:25', '2018-08-22 17:06:30'), ('2', '1', '宽距站姿深蹲', 'WIDE-STANCE SQUAT', null, '<p>&bull;&nbsp; <strong>距离比中距站姿宽一个脚掌</strong></p>', '<p><strong>&bull; 臀部向后向下</strong></p>\r\n\r\n<p><strong>&bull; 膝盖向外</strong></p>\r\n\r\n<p><strong>&bull; 挺胸</strong></p>\r\n\r\n<p><strong>&bull; 收腹</strong></p>\r\n\r\n<p><strong>&bull; 臀部略高于膝盖水平线，膝盖保持90度</strong></p>', '<p>&bull; 起身时脚跟发力，激活你的臀大肌</p>\r\n\r\n<p>&bull; 用双脚推地面</p>\r\n\r\n<p>&bull; 起身向上时收紧臀部</p>', '[\"images\\/18910b8b5547329ddb35ed2377a6e40d.png\"]', '2018-08-22 16:53:29', '2018-08-22 17:52:13'), ('3', '1', '中距深蹲', 'MID-STANCE SQUAT', null, '<p><strong>&bull; 将杠铃举至上背部肉最多处 </strong></p>\r\n\r\n<p><strong>&bull; 双脚比胯略宽，同时脚趾向外 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸，轻轻夹紧肩胛骨</strong></p>', '<p><strong>&bull; 臀部向后向下蹲 </strong></p>\r\n\r\n<p><strong>&bull; 膝盖向前对齐脚尖</strong></p>\r\n\r\n<p><strong>&bull; 臀部略高于膝盖水平线，膝盖保持90度</strong></p>', '<p>&bull; 动作结束时臀部位于肩膀正下方 &bull; 感受股四头肌的压力</p>\r\n\r\n<p>&bull; 在下半程2次一半时收紧腹部</p>', '[\"images\\/dc80b5d9042f43e194997540fe6f3bed.png\"]', '2018-08-22 14:22:09', '2018-08-22 17:54:29'), ('4', '1', '分腿站姿', 'SPLIT STANCE', null, '<p>与基本站姿一样</p>\r\n\r\n<p>&bull; 双脚与跨同宽并平行</p>\r\n\r\n<p><strong>&bull; 后脚跟抬起 </strong></p>\r\n\r\n<p><strong>&bull; 微微弯曲膝盖 </strong></p>\r\n\r\n<p>&bull; 重心位于双腿之间</p>', null, null, '[\"images\\/f744b6fe62201401172e074f92e046fa.png\"]', '2018-08-22 14:22:27', '2018-08-22 17:55:01'), ('5', '1', '推胸', 'CHEST PRESS', null, '<p><strong>&bull; 双手打开宽握杠铃 </strong></p>\r\n\r\n<p>&bull; 将杠铃举至肩部之上</p>\r\n\r\n<p><strong>&bull; 收腹，下背部靠向踏板 </strong></p>\r\n\r\n<p>&bull; 双脚打开与髋同宽，并靠近踏板</p>', '<p><strong>&bull; 将杠铃举至胸中部 </strong></p>\r\n\r\n<p><strong>&bull; 手肘与踏板在同一水平上</strong></p>', '<p>&bull; 下降时收紧肩胛骨，打开胸腔</p>\r\n\r\n<p>&bull; 上背部贴紧踏板，保持身体上半部稳定</p>', '[\"images\\/3e3fa6674c9a41c4b202e9b71bcdab2b.png\"]', '2018-08-22 14:23:08', '2018-08-22 17:56:36'), ('6', '1', 'A字推举', 'A-PRESS', null, '<p><strong>&bull; 杠铃片面向内，手肘向内 </strong></p>\r\n\r\n<p>&bull; 手掌距离稍窄于肩宽</p>\r\n\r\n<p><strong>&bull; 弯曲手肘，与踏板同高 </strong></p>\r\n\r\n<p>&bull; 举起时挤压胸部</p>\r\n\r\n<p>&bull; 在顶端时呈一个大写的&ldquo;A&rdquo;</p>', null, null, '[\"images\\/d850a780a14b44225919bb865c722c59.png\"]', '2018-08-22 14:25:09', '2018-08-22 17:57:16'), ('7', '1', '俯卧撑', 'BENCH PUSHUP', null, '<p>&bull; 双手打开</p>\r\n\r\n<p>&bull; 收腹</p>\r\n\r\n<p>&bull; 保持背部直立</p>', '<p>&bull; 胸部向下至手肘水平线上</p>', '<p>&bull; 用力推开地板／踏板</p>', '[\"images\\/95c21ae9dc80d13ad88d1f01a3604869.png\"]', '2018-08-22 14:25:20', '2018-08-22 17:58:08'), ('8', '1', '单臂杠铃硬拉', 'SINGLE-ARM PLATE DEADLIFT', null, '<p><strong>&bull; 基本站姿 </strong></p>\r\n\r\n<p><strong>&bull; 双脚打开，与髋同宽 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸&mdash;&mdash;腹部收紧</strong></p>', '<p><strong>&bull; 臀部前倾 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸</strong></p>\r\n\r\n<p><strong>&bull; 胸部和肩膀摆正</strong></p>', '<p>&bull; 身躯中线在双脚中间</p>', '[\"images\\/1fe23790f050b100c45025bebfc73cb1.png\"]', '2018-08-22 14:27:51', '2018-08-22 17:58:32'), ('9', '1', '硬拉', 'DEADLIFT', null, '<p>&bull; 基本站姿</p>\r\n\r\n<p>&bull; 膝盖弯曲（成20度）</p>\r\n\r\n<p>&bull; 挺胸收腹</p>\r\n\r\n<p>&bull; 双肘向后，轻轻收紧肩胛骨</p>\r\n\r\n<p>&bull; 收下巴</p>', '<p>&bull; 髋部驱动身体向前倾斜，保持挺胸</p>\r\n\r\n<p>&bull; 将杠铃落至膝盖</p>\r\n\r\n<p>&bull; 收下巴，眼睛看向前方6.5英尺处（2米）</p>', '<p>&bull; 整个过程中肩胛骨保持收紧</p>\r\n\r\n<p>&bull; 起身时收紧你的股后肌群和臀肌</p>\r\n\r\n<p>&bull; 脚跟紧紧着地</p>', '[\"images\\/23f67ee5070047050f5a7cacdabf2821.png\"]', '2018-08-22 14:28:19', '2018-08-22 17:58:57'), ('10', '1', '单臂杠铃片俯身划船', 'SINGLE-ARM PLATE DEADROW', null, '<p><strong>&bull; 基本站姿</strong></p>\r\n\r\n<p><strong>&bull; 双脚打开，与髋同宽</strong></p>\r\n\r\n<p><strong>&bull; 挺胸&mdash;&mdash;腹部收紧</strong></p>', '<p>&bull; 臀部前倾</p>\r\n\r\n<p>&bull; 挺胸</p>\r\n\r\n<p>&bull; 杠铃片划船至下肋骨</p>\r\n\r\n<p>&bull; 胸部和肩部摆正</p>', null, '[\"images\\/1435f5f9aea1b486de2da6a855c98070.png\"]', '2018-08-22 14:29:07', '2018-08-22 17:59:39'), ('11', '1', '推举', 'CLEAN & PRESS', null, '<p><strong>&bull; 基本站姿 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸收腹 </strong></p>\r\n\r\n<p><strong>&bull; 膝盖弯曲</strong></p>', '<p>&bull; 膝盖再弯曲些，双腿发力将杠铃拉起</p>\r\n\r\n<p>&bull; 在上拉阶段保持手肘高于杠铃</p>\r\n\r\n<p>&bull; 杠铃靠近身体，拉到胸部</p>\r\n\r\n<p><strong>&bull; 膝盖弯曲，落到杠铃杆下方 </strong></p>\r\n\r\n<p><strong>&bull; 将杠铃拉起至锁骨前后保持住 </strong></p>\r\n\r\n<p>&bull; 推向上方</p>\r\n\r\n<p><strong>&bull; 双腿发力将杠铃举起 </strong></p>\r\n\r\n<p><strong>&bull; 杠铃举至头顶时保持收腹</strong></p>\r\n\r\n<p><strong>&bull; 双肘微微向前 </strong></p>\r\n\r\n<p>&bull; 再次弯曲双腿回到基本站姿</p>\r\n\r\n<p>&bull; 将手肘抬高上翻将杠铃放低 双肘要快速移动到杠铃杆下方。好像要拉起你的T恤一样将杠铃举起。在胸前接住杠铃，如何双腿发力推起。</p>', null, '[\"images\\/2f31676e130f21c72726bfcfd7dba94d.png\"]', '2018-08-22 14:30:40', '2018-08-22 18:00:06'), ('12', '1', '俯身划船', 'DEADROW', null, '<p><strong>&bull; 基本站姿 </strong></p>\r\n\r\n<p><strong>&bull; 膝盖弯曲（成20度） </strong></p>\r\n\r\n<p><strong>&bull; 挺胸收腹 </strong></p>\r\n\r\n<p>&bull; 手肘向后，轻轻收紧肩胛骨</p>\r\n\r\n<p><strong>&bull; 收下巴</strong></p>', '<p><strong>&bull; 将杠铃拉至膝盖处 </strong></p>\r\n\r\n<p><strong>&bull; 拉到肚脐 </strong></p>\r\n\r\n<p><strong>&bull; 收紧肩胛骨</strong></p>', '<p>&bull; 将杠铃压向大腿上</p>\r\n\r\n<p>&bull; 收紧肩胛骨</p>\r\n\r\n<p>&bull; 弯曲双腿保持身体稳定，臀部下坐</p>\r\n\r\n<p>&bull; 让肩膀远离耳朵</p>\r\n\r\n<p>在俯身划船中强调肩胛骨要收紧，能够确保训练到肩胛骨牵缩肌，并帮助参与者进行肩关节铰链时减少倾斜度。</p>\r\n\r\n<p>这些肌肉有助于身体保持稳定从而预防受伤。</p>', '[\"images\\/72611c1bad79d51e3fe9c0e51a30719c.png\"]', '2018-08-22 14:31:09', '2018-08-22 18:00:34'), ('13', '1', '宽距划船', 'WIDE ROW', null, '<p><strong>&bull; 基本站姿 </strong></p>\r\n\r\n<p>&bull; 双手宽握杠铃</p>\r\n\r\n<p><strong>&bull; 腹部收紧&mdash;&mdash;挺胸</strong></p>', '<p>&bull; 杠铃到膝盖高度</p>\r\n\r\n<p><strong>&bull; 杠铃从膝盖划船至胸部下方 </strong></p>\r\n\r\n<p><strong>&bull; 收下巴&mdash;&mdash;眼睛盯着前方约2米的地方 </strong></p>\r\n\r\n<p><strong>&bull; 挤压肩胛骨</strong></p>', '<p><strong>&bull; 努力，弯曲或是抓紧杠铃</strong></p>', '[\"images\\/98d22312e2b53b6325ced84277342f84.png\"]', '2018-08-22 14:31:44', '2018-08-22 18:01:45'), ('14', '1', '站姿三头肌过顶伸展', 'STANDING OVERHEAD TRICEP PLATE EXTENSION', null, '<p>&bull; 分腿站姿，膝盖放松，重心位于两脚中间</p>\r\n\r\n<p>&bull; 肩膀下沉</p>\r\n\r\n<p>&bull; 收腹</p>\r\n\r\n<p>&bull; 挺胸</p>\r\n\r\n<p>&bull; 将杠铃片举过头顶，手臂微微向前，你可以看到自己的双肘</p>', '<p>&bull; 将杠铃片下落至颈部底端</p>\r\n\r\n<p>&bull; 完全伸展举到头顶 &bull; 双肘收紧</p>', '<p>&bull; 沉于双腿，保持核心稳定</p>\r\n\r\n<p>&bull; 保持肩膀向后向下，让三头肌用力</p>', '[\"images\\/51184be03c5805a9756feaf4911ceee4.png\"]', '2018-08-22 14:32:10', '2018-08-22 18:02:20'), ('15', '1', '肱三头肌俯卧撑', 'TRICEP BENCH PUSHUP', null, '<p>&bull; 双手在肩膀下方</p>\r\n\r\n<p>&bull; 收腹</p>\r\n\r\n<p>&bull; 后背直立</p>', '<p>&bull; 胸部往下与手肘水平线成一条直线</p>\r\n\r\n<p>&bull; 双肘夹紧肋骨</p>\r\n\r\n<p>&bull; 用力推开地面／踏板</p>', null, '[\"images\\/0aac8bd8f023192ee85a08fbd87d776c.png\"]', '2018-08-22 14:35:52', '2018-08-22 18:03:06'), ('16', '1', '肱二头肌弯举', 'BICEP CURL', null, '<p><strong>&bull; 放松膝盖&mdash;&mdash;分腿站姿或基本站姿 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸</strong></p>\r\n\r\n<p><strong>&bull; 腹部向内收紧</strong></p>', '<p>&bull; 弯举杠铃至肩膀前方</p>\r\n\r\n<p>&bull; 往下伸展一直到大腿</p>', '<p>&bull; 手肘放在身体两侧</p>\r\n\r\n<p>&bull; 身体保持静止</p>', '[\"images\\/12973f82a515106950d17a0412d7407c.png\"]', '2018-08-22 14:36:13', '2018-08-22 18:03:30'), ('17', '1', '向后弓箭步蹲', 'BACKWARD-STEPPING LUNGE', null, '<p><strong>&bull; 向后一大步</strong></p>\r\n\r\n<p><strong>&bull; 双脚与髖同宽</strong></p>\r\n\r\n<p><strong>&bull; 臀部和肩部放平，并正对前方</strong></p>\r\n\r\n<p><strong>&bull; 膝盖对准脚趾 </strong></p>\r\n\r\n<p><strong>&bull; 收腹挺胸</strong></p>', '<p><strong>&bull; 弯曲膝盖，后膝盖朝向地面</strong></p>\r\n\r\n<p><strong>&bull; 前腿与地面保持平行</strong></p>', '<p>&bull; 身体尽量保持在低端，孤立腿部</p>', '[\"images\\/909be205018eaa4d34d316bf652d9f7b.png\"]', '2018-08-22 14:36:55', '2018-08-22 18:04:02'), ('18', '1', '站立后三角肌飞鸟', 'STANDING REAR DELTOID FLY', null, '<p><strong>&bull; 基本站姿 </strong></p>\r\n\r\n<p><strong>&bull; 臀部前倾 </strong></p>\r\n\r\n<p>&bull; 身体呈45度角</p>\r\n\r\n<p><strong>&bull; 挺胸，腹部收紧 </strong></p>\r\n\r\n<p><strong>&bull; 收下吧，后颈伸长，眼睛盯着前方1米处</strong></p>', '<p><strong>&bull; 手肘带动动作</strong></p>\r\n\r\n<p><strong>&bull; 手肘微曲 </strong></p>\r\n\r\n<p><strong>&bull; 挤压肩胛骨 </strong></p>\r\n\r\n<p>&bull; 目标是稳定</p>', '<p>&bull; 手肘带动动作</p>\r\n\r\n<p>&bull; 保持挺胸；肩膀不要下落</p>\r\n\r\n<p>&bull; 肩膀远离耳朵</p>', '[\"images\\/151309a38cd57b4ccb658bb28373a072.png\"]', '2018-08-22 14:37:12', '2018-08-22 18:04:19'), ('19', '1', '中距站姿杠铃片颈前深蹲', 'PLATE FRONT SQUAT – MID STANCE', null, '<p><strong>&bull; 双脚比髋略宽，脚趾打开 </strong></p>\r\n\r\n<p>&bull; 杠铃片与地面平行，举至锁骨前</p>\r\n\r\n<p>&bull; 手肘位于杠铃片之下</p>\r\n\r\n<p><strong>&bull; 挺胸收腹</strong></p>', '<p><strong>&bull; 臀部向下向后坐</strong></p>\r\n\r\n<p><strong>&bull; 膝盖对准脚趾</strong></p>\r\n\r\n<p><strong>&bull; 臀部不低于膝盖水平线保，膝盖成90度</strong></p>', '<p>&bull; 起身时脚跟发力，激活你的臀肌</p>\r\n\r\n<p>&bull; 起身向上时收紧臀部</p>', '[\"images\\/6d7a662b5944ceebfded1305dfbb01fb.png\"]', '2018-08-22 14:38:36', '2018-08-22 18:04:38'), ('20', '1', '站立侧平举', 'STANDING SIDE RAISE', null, '<p><strong>&bull; 基本站姿</strong></p>\r\n\r\n<p><strong>&bull; 手肘呈90度 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸&mdash;&mdash;腹部收紧</strong></p>', '<p><strong>&bull; 抬高手肘，位于肩膀下方</strong></p>\r\n\r\n<p>&bull; 手肘稍前于肩膀</p>\r\n\r\n<p>&bull; 手肘带动动作</p>\r\n\r\n<p><strong>&bull; 收下巴</strong></p>', '<p>&bull; 身体保持静止，孤立肩膀</p>\r\n\r\n<p>&bull; 肩膀远离耳朵</p>\r\n\r\n<p><strong>可选动作</strong>：为了加大强度，加大手肘的距离</p>\r\n\r\n<p>保持手肘略微向前，确保我们将手臂抬高到与肩胛骨同高，帮助我们回旋肌均匀发力，保护肩膀。到肩膀高度就停下动作，可以降低肩膀受伤的可能性（压迫到肩部组织）。</p>', '[\"images\\/8637da350e2670fa22b4dd89a359fdca.png\"]', '2018-08-22 14:39:15', '2018-08-22 18:05:09'), ('21', '1', '站立直身划船', 'STANDING UPRIGHT ROW', null, '<p><strong>&bull; 基本站姿 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸&mdash;&mdash;腹部收紧</strong></p>\r\n\r\n<p>&bull; 肩胛骨稍稍夹紧</p>', '<p><strong>&bull; 杠铃抬高到下胸部 </strong></p>\r\n\r\n<p>&bull; 手肘在杠铃上方</p>\r\n\r\n<p>&bull; 保持杠铃靠近身体</p>', '<p>&bull; 手肘带动动作</p>\r\n\r\n<p>&bull; 挤压肩胛骨</p>\r\n\r\n<p>保持挺胸，并且收紧肩胛骨于最佳位置，承受负重。 抬高杠铃，不高于下胸部，降低肩膀受伤的可能性（压迫到肩部组织）。</p>', '[\"images\\/465ed87ca0c677b80275026e6f7c1fc5.png\"]', '2018-08-22 14:39:38', '2018-08-22 18:05:28'), ('22', '1', '站立过顶推举', 'STANDING OVERHEAD PRESS', null, '<p><strong>&bull; 分腿站姿</strong></p>\r\n\r\n<p>&bull; 后腿受力均衡，膝盖放松</p>\r\n\r\n<p><strong>&bull; 挺胸&mdash;&mdash;腹部收紧 </strong></p>\r\n\r\n<p><strong>&bull; 杠铃与下巴同高，手肘在手腕下方</strong></p>', '<p>&bull; 将杠铃向上推</p>\r\n\r\n<p>&bull; 动作顶端时手肘保持放松，稍微向前</p>\r\n\r\n<p>&bull; 杠铃在头部上方时收紧腹部</p>', '<p>&bull; 保持身体直立，不要向后靠&mdash;&mdash;让肩膀运动</p>', '[\"images\\/782f11d699481eaa9a74f016eb5e7d85.png\"]', '2018-08-22 14:56:05', '2018-08-22 18:05:45'), ('23', '1', '回旋肌侧平举', 'ROTATOR RAISE', null, '<p><strong>&bull; 基本站姿 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸，腹部收紧 </strong></p>\r\n\r\n<p><strong>&bull; 手肘呈90度&mdash;&mdash;杠铃片面向内</strong></p>', '<p>&bull; 与肩同高</p>\r\n\r\n<p>&bull; 低处的前部回到肩膀高度</p>\r\n\r\n<p>&bull; 旋转肩膀，打开双臂</p>\r\n\r\n<p>&bull; 回到起始姿势</p>', '<p>&bull; 拉回来时挤压肩胛骨</p>\r\n\r\n<p>&bull; 完成练习的所有阶段</p>', '[\"images\\/915f6fb6c8a1aaa46d62dd9dfd567552.png\"]', '2018-08-22 14:56:30', '2018-08-22 18:06:18'), ('24', '1', '站立推举', 'STANDING PUSH PRESS', null, '<p><strong>&bull; 分腿站姿 </strong></p>\r\n\r\n<p>&bull; 后腿受力均衡，膝盖放松</p>\r\n\r\n<p><strong>&bull; 挺胸&mdash;&mdash;腹部收紧 </strong></p>\r\n\r\n<p>&bull; <strong>杠铃到锁骨位置</strong>，手肘在手腕下方</p>', '<p>&bull; 向上推杠铃</p>\r\n\r\n<p>&bull; 动作顶端时手肘保持放松，稍微向前</p>\r\n\r\n<p>&bull; 杠铃在头部上方时收紧腹部</p>\r\n\r\n<p>&bull; 保持身体直立，不要向后靠&mdash;&mdash;让肩膀运动</p>', null, '[\"images\\/f2c0c0da072473c897d06c5247d2df19.png\"]', '2018-08-22 14:57:10', '2018-08-22 18:06:52'), ('25', '1', '杠铃片卷腹飞鸟', 'PLATE CRUNCH FLY', null, '<p>&bull; 仰卧，一手拿着杠铃片</p>\r\n\r\n<p>&bull; 另一侧手心向上</p>\r\n\r\n<p>&bull; 手肘微屈</p>', '<p>&bull; 用杠铃片画一个大弧，来到肩膀正上方</p>\r\n\r\n<p>&bull; 双侧肩胛骨抬起，离开地面</p>\r\n\r\n<p><strong>&bull; 卷腹时肋骨靠向臀部</strong></p>\r\n\r\n<p><strong>&bull; 收下巴，眼睛看向膝盖</strong></p>', '<p>&bull; 杠铃片在肩膀正上方时，在顶点保持一会，让核心有效负重</p>', '[\"images\\/30e818a782d20ce010e8a0ea2c11a573.png\"]', '2018-08-22 14:57:27', '2018-08-22 18:07:21'), ('26', '1', '杠铃片卷腹', 'PLATE CRUNCH', null, '<p>&bull; 将杠铃片放在额头</p>\r\n\r\n<p><strong>&bull; 双脚靠近臀部 </strong></p>\r\n\r\n<p><strong>&bull; 收下巴</strong></p>', '<p><strong>&bull; 肋骨靠向髋关节</strong></p>', '<p>&bull; 肩胛骨抬起更高，离开地面</p>', '[\"images\\/97bb6b3a3a160644f8db7f2e30197b38.png\"]', '2018-08-22 14:57:52', '2018-08-22 18:08:06'), ('27', '1', '臀桥', 'HIP BRIDGE', null, '<p>&bull; 杠铃片放在大腿上，双手支撑杠铃片</p>\r\n\r\n<p>&bull; 双腿分开，与肩同宽</p>', '<p>&bull; 脚跟支撑用力，抬高臀部</p>\r\n\r\n<p><strong>&bull; 挤压臀大肌 </strong></p>\r\n\r\n<p>&bull; 慢慢下来</p>', null, '[\"images\\/af3572976bf822a394ee9e98383aa850.png\"]', '2018-08-22 14:58:10', '2018-08-22 18:08:23'), ('28', '1', '向后箭步下蹲加侧平举', 'BACKWARD-STEPPING LUNGE WITH SIDE RAISE', null, '<p><strong>&bull; 双腿分开，与髋同宽 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸</strong></p>\r\n\r\n<p><strong>&bull; 手肘呈90度</strong></p>', '<p><strong>&bull; 向后一大步 </strong></p>\r\n\r\n<p><strong>&bull; 后腿膝盖向地面弯曲</strong></p>\r\n\r\n<p><strong>&bull; 前腿大腿平行</strong></p>\r\n\r\n<p><strong>&bull; 挺胸，腹部收紧</strong></p>\r\n\r\n<p><strong>&bull; 手肘抬到侧面&mdash;&mdash;就在肩膀以下 </strong></p>\r\n\r\n<p><strong>&bull; 手肘稍稍向前</strong></p>\r\n\r\n<p>&nbsp;</p>', '<p>&bull; 箭步下蹲时保持全幅范围&mdash;&mdash;整体训练</p>', '[\"images\\/9173244a4630321b513045a7e873e9e6.png\"]', '2018-08-22 14:59:12', '2018-08-22 18:08:43'), ('29', '1', '双臂过顶杠铃片卷腹', 'DOUBLE ARM OVERHEAD PLATE CRUNCH', null, '<p>&bull; 手臂伸展过头顶</p>\r\n\r\n<p>&bull; 收下巴</p>', '<p>&bull; 从肋骨处滑到臀部</p>\r\n\r\n<p>&bull; 肱二头肌在耳朵旁边</p>\r\n\r\n<p>&bull; 动作由卷腹驱动</p>', '<p>&bull; 尝试一下，向上卷腹，更高一点</p>\r\n\r\n<p>&bull; 动作由卷腹驱动&mdash;&mdash;手臂在耳朵旁边</p>', null, '2018-08-22 14:59:30', '2018-08-22 17:48:01'), ('30', '1', '向后箭步下蹲加过顶杠铃片推举', 'BACKWARD STEPPING LUNGE WITH OVERHEAD PLATE PRESS', null, '<p><strong>&bull; 双脚打开，与髋同宽 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸</strong></p>\r\n\r\n<p><strong>&bull; 手肘呈90度 </strong></p>\r\n\r\n<p><strong>&bull; 杠铃片向前</strong></p>', '<p>&bull; 向后一大步</p>\r\n\r\n<p>&bull; 后腿膝盖向地板弯曲</p>\r\n\r\n<p>&bull; 前腿大腿平行</p>\r\n\r\n<p>&bull; 臀部和肩膀</p>\r\n\r\n<p>&bull; 挺胸，腹部收紧</p>\r\n\r\n<p>&bull; 居高杠铃片</p>\r\n\r\n<p>&bull; 腹部收紧</p>\r\n\r\n<p>&bull; 挺胸</p>', '<p>&bull; 箭步下蹲全幅范围</p>\r\n\r\n<p>&bull; 把杠铃片用力向天花板推</p>', '[\"images\\/c531f6de36cb2b926395faf449211071.png\"]', '2018-08-22 15:00:03', '2018-08-22 18:09:07'), ('31', '1', '三次弹动静态箭步蹲加回旋肌侧平举', 'TRIPLE PULSE STATIC LUNGE WITH ROTATOR RAISE', null, '<p><strong>&bull; 双脚打开，与髋同宽</strong></p>\r\n\r\n<p><strong>&bull; 大步箭步下蹲</strong></p>\r\n\r\n<p><strong>&bull; 挺胸 </strong></p>\r\n\r\n<p><strong>&bull; 手肘呈90度 </strong></p>\r\n\r\n<p><strong>&bull; 前腿大腿平行</strong></p>\r\n\r\n<p><strong>&bull; 臀部和肩膀正对前方</strong></p>', '<p><strong>&bull; 手肘抬到提测&mdash;&mdash;在肩膀下方 </strong></p>\r\n\r\n<p><strong>&bull; 手肘稍稍向前</strong></p>\r\n\r\n<p><strong>&bull; 前部向上转</strong></p>\r\n\r\n<p><strong>&bull; 挤压肩胛骨 </strong></p>\r\n\r\n<p><strong>&bull; 挺胸&mdash;&mdash;腹部收紧</strong></p>', '<p>&bull; 箭步下蹲保持全幅范围&mdash;&mdash;整体训练</p>', '[\"images\\/7250d57f318ce2f34367b284eaac6077.png\"]', '2018-08-22 15:04:06', '2018-08-22 18:09:49'), ('32', '1', '向后一步单臂杠铃片划船', 'SINGLE ARM PLATE ROW WITH BACKWARD STEP', null, '<p><strong>&bull; 基本站姿</strong></p>\r\n\r\n<p><strong>&bull; 挺胸&mdash;&mdash;腹部收紧</strong></p>', '<p><strong>&bull; 臀部前倾 </strong></p>\r\n\r\n<p><strong>&bull; 摆正肩膀 </strong></p>\r\n\r\n<p><strong>&bull; 鼻子要超过脚趾 </strong></p>\r\n\r\n<p><strong>&bull; 摆正臀部 </strong></p>\r\n\r\n<p><strong>&bull; 杠铃片到下肋骨 </strong></p>\r\n\r\n<p><strong>&bull; 挤压肩胛骨向脊柱</strong></p>', '<p>&bull; 保持重心向前，给臀大肌负重</p>\r\n\r\n<p>&bull; 胸部中线保持在大脚趾之间</p>', '[Null]', '2018-08-22 15:05:11', '2018-08-22 17:31:15'), ('33', '2', '单车设置', 'BIKE SETUP', null, '<p>车座高度</p>\r\n\r\n<p>将脚置于十二点和六点的位置。抽出下方的一只 脚，脚后跟置于踏板上。腿和臀部在一条直线上， 脚后跟应刚好触到踏板-车座高度最有利于发力。如果脚后跟很容易触到踏板，膝关节弯曲，则说明车座太低了。如果不倾斜臀部则无法触到踏板，则说明车座太高了。一旦将脚放回踏板/趾笼，检查膝盖是否轻微弯曲&mdash;&mdash;最佳角度是25度。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>车座从前到后</p>\r\n\r\n<p>将踏板置于三点和九点的位置，车座安置好，使前膝与踏板轴或前踏板足趾护带顶部成直线。如果膝盖位于踏板轴后，那么车座需要前移。如果膝盖位于踏板轴前，车座需要后移。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>车把高度</p>\r\n\r\n<p>车把高度应略低于车座或与之位于同一水平线。初学者或有腰部后背问题的人应使车把略高于车座。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>车把前后</p>\r\n\r\n<p>竞速时，上臂和躯干应成90度角。如果感觉在车座 上需要向前滑动才能达到90度角，将把手移近一点。</p>', null, null, null, '2018-10-10 22:56:31', '2018-10-10 22:56:31'), ('34', '2', '轻松骑行', 'RIDE EASY', null, '<ul>\r\n	<li>臀部以上向前倾</li>\r\n	<li>坐回车座</li>\r\n	<li>双手分开，与肩同宽</li>\r\n	<li>上臂和躯干成<em>90</em>度角</li>\r\n	<li>颈后拉长，收下巴</li>\r\n	<li>抬胸</li>\r\n	<li>肩膀向后</li>\r\n	<li>肘部放松</li>\r\n	<li>上身放松</li>\r\n	<li>臀部、膝盖、脚踝成直线</li>\r\n	<li>膝盖骨中间与第二趾成直线</li>\r\n	<li>眼睛位于车把前方</li>\r\n</ul>', null, '<ul>\r\n	<li>肩膀远离耳朵</li>\r\n	<li>放松上身，帮助恢复</li>\r\n	<li>分开双手，帮助呼吸</li>\r\n</ul>', '[Null]', '2018-10-10 23:01:51', '2018-10-10 23:37:31'), ('35', '2', '竞速', 'RACING', null, '<ul>\r\n	<li>臀部以上向前倾</li>\r\n	<li>向前伸出手臂</li>\r\n	<li>将臀部向后滑动</li>\r\n	<li>上臂和躯干成<em>90</em>度角</li>\r\n	<li>抬胸</li>\r\n	<li>双肩向后、向下</li>\r\n	<li>弯曲肘部</li>\r\n	<li>收腹、绷紧</li>\r\n	<li>颈后拉长，收下巴</li>\r\n	<li>眼睛位于车把前方</li>\r\n	<li>臀部、膝盖、脚踝成直线</li>\r\n</ul>', null, '<ul>\r\n	<li>前伸身体<em>&ndash;</em>保持肘部弯曲</li>\r\n	<li>坐回车座；感觉臀部和腿后肌</li>\r\n	<li>腹部有力，保持上身静止</li>\r\n	<li>膝盖对齐，膝盖骨中间与脚中间成直线</li>\r\n</ul>', null, '2018-10-10 23:03:51', '2018-10-10 23:03:51'), ('36', '2', '竞速（向前）', 'RACING (FORWARD)', null, '<ul>\r\n	<li>向前伸出手臂</li>\r\n	<li>向前滑动</li>\r\n	<li>上臂和躯干成<em>90</em>度角</li>\r\n	<li>抬胸</li>\r\n	<li>双肩向后、向下</li>\r\n	<li>弯曲肘部</li>\r\n	<li>收腹、绷紧</li>\r\n	<li>颈后拉长，收下巴</li>\r\n	<li>眼睛位于车把前方</li>\r\n	<li>脚趾略微向下</li>\r\n	<li>臀部、膝盖、脚踝成直线</li>\r\n	<li>膝盖骨中间与脚中间成直线</li>\r\n</ul>', null, '<ul>\r\n	<li>在车座上向前滑动，将膝盖置于发力位置</li>\r\n	<li>帮助更好地带动股四头肌</li>\r\n	<li>脚尖向下，用脚小转幅、快速蹬车</li>\r\n	<li>身体、臀部和上身保持不动；支撑腹部</li>\r\n</ul>', null, '2018-10-10 23:05:29', '2018-10-10 23:05:29'), ('37', '2', '有氧竞速（向前）', 'AERO–RACING (FORWARD)', null, '<ul>\r\n	<li>手置于<em>&ldquo;D&rdquo;</em>中</li>\r\n	<li>在车座上向前滑动</li>\r\n	<li>肘部向内、向下</li>\r\n	<li>肩膀下垂</li>\r\n	<li>上身放低</li>\r\n	<li>眼睛位于车把前方</li>\r\n	<li>脚趾略微向下</li>\r\n</ul>', null, '<ul>\r\n	<li>放低上半身，如同紧跟前方骑手</li>\r\n	<li>调整至下风处，借助空气动力</li>\r\n</ul>', null, '2018-10-10 23:06:20', '2018-10-10 23:06:20'), ('38', '2', '站姿冲击', 'STANDING ATTACK', null, '<ul>\r\n	<li>双手置于车把端部</li>\r\n	<li>身体重心略前倾</li>\r\n	<li>收腹、绷紧</li>\r\n	<li>抬胸</li>\r\n	<li>眼睛位于车把前方</li>\r\n</ul>', null, '<ul>\r\n	<li>臀部稍向前移，感觉股四头肌发力</li>\r\n	<li>躯干发力，带动腿部发力</li>\r\n	<li>力量集中在前身，股四头肌发力！</li>\r\n	<li>向前，股四头肌发力！</li>\r\n</ul>', null, '2018-10-10 23:06:56', '2018-10-10 23:06:56'), ('39', '2', '坐姿恢复', 'SEATED RECOVERY', null, '<ul>\r\n	<li>坐在车座后部</li>\r\n	<li>肩膀向后</li>\r\n	<li>抬胸</li>\r\n	<li>臀部、膝盖、脚踝成直线</li>\r\n</ul>', null, '<ul>\r\n	<li>展开胸部，喘口气</li>\r\n	<li>双臂放松垂于两侧。</li>\r\n	<li>吸气，氧气可提供能量</li>\r\n</ul>', null, '2018-10-10 23:07:27', '2018-10-10 23:07:27'), ('40', '2', '站姿爬坡', 'STANDING CLIMB', null, '<ul>\r\n	<li>双手置于车把端部，在放松状态下握住车把</li>\r\n	<li>臀部稍高于座位前方</li>\r\n	<li>收腹、绷紧</li>\r\n	<li>抬胸</li>\r\n	<li>双肩向后、向下</li>\r\n	<li>肘部放松、向内</li>\r\n	<li>身体重心左右摇摆</li>\r\n	<li>眼睛位于车把前方</li>\r\n</ul>', null, '<ul>\r\n	<li>躯干有力，方可爬坡骑行有力</li>\r\n	<li>感觉臀部刚好触到车座前端</li>\r\n	<li>蹬下踏板，尽力发力</li>\r\n	<li>拉起车把，抵消向下的推力</li>\r\n	<li>将身体重心保持在腿部，而非车把</li>\r\n</ul>', null, '2018-10-10 23:08:24', '2018-10-10 23:08:24'), ('41', '2', '坐姿爬坡', 'POWER CLIMB', null, '<ul>\r\n	<li>臀部以上向前倾</li>\r\n	<li>向前伸出手臂</li>\r\n	<li>将臀部向后滑动</li>\r\n	<li>抬胸</li>\r\n	<li>双肩向后、向下</li>\r\n	<li>弯曲肘部</li>\r\n	<li>收腹、绷紧</li>\r\n	<li>来回推拉</li>\r\n	<li>颈后拉长，收下巴</li>\r\n	<li>眼睛位于车把前方</li>\r\n	<li>臀部、膝盖、脚踝成直线</li>\r\n	<li>膝盖中间与脚中间在成直线</li>\r\n</ul>', null, '<ul>\r\n	<li>分开双手-更好地支持你发力</li>\r\n	<li>用股四头肌发力向前推，用腿后肌拉</li>\r\n	<li>用脚大幅度蹬车</li>\r\n	<li>来回推拉</li>\r\n	<li>坐在车座上&ndash;加长踏板轴，更有助于发力</li>\r\n</ul>', null, '2018-10-10 23:09:07', '2018-10-10 23:09:07'), ('42', '2', '障碍爬坡', 'PULLBACK CLIMB', null, '<ul>\r\n	<li>臀部稍微后移，上身保持不变</li>\r\n	<li>腹部内收</li>\r\n	<li>抬胸</li>\r\n	<li>双肩向后、放松</li>\r\n	<li>眼睛位于车把前方</li>\r\n</ul>', null, '<ul>\r\n	<li>稳住臀部，感觉腿后部用力。</li>\r\n	<li>稍微后移，臀部用力</li>\r\n</ul>', null, '2018-10-10 23:09:45', '2018-10-10 23:09:45'), ('43', '2', '站姿恢复', 'STANDING RECOVERY', null, '<ul>\r\n	<li>高高站在自行车上</li>\r\n	<li>胸挺起，展开</li>\r\n	<li>拉长背部</li>\r\n	<li>伸腿，用力伸一点</li>\r\n	<li>脚跟向下</li>\r\n</ul>', null, '<ul>\r\n	<li>起身，恢复</li>\r\n	<li>感受腿部和背部的放松</li>\r\n	<li>花点时间恢复体力</li>\r\n</ul>', null, '2018-10-10 23:10:49', '2018-10-10 23:10:49');
COMMIT;

