DROP TABLE IF EXISTS `question_dictionary`;
CREATE TABLE `question_dictionary` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `attr_name` varchar(64) DEFAULT NULL COMMENT '属性名称',
  `attr_value` varchar(64) DEFAULT NULL COMMENT '属性值',
  `type` varchar(64) DEFAULT NULL COMMENT '分类属性',
  `parent_id` int(10) DEFAULT '0' COMMENT '父节点',
  `level` int(10) DEFAULT '0' COMMENT '等级',
  `memo` varchar(128) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

