-- ----------------------------
--  Table structure for `question_sm`
-- ----------------------------
DROP TABLE IF EXISTS `question_sm`;
CREATE TABLE `question_sm` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `question_id` varchar(64) DEFAULT NULL COMMENT '问卷编号',
  `qq` varchar(64) DEFAULT NULL COMMENT 'qq',
  `wechat` varchar(64) DEFAULT NULL COMMENT '微信',
  `age` int(4) DEFAULT NULL COMMENT '年龄',
  `height` varchar(10) DEFAULT NULL COMMENT '身高',
  `weight` varchar(10) DEFAULT NULL COMMENT '体重',
  `memo` varchar(256) DEFAULT NULL COMMENT '备注',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `attr_sex` int(10) DEFAULT NULL COMMENT '性',
  `attr_animal` int(10) DEFAULT NULL COMMENT '动物',
  `attr_toy` int(10) DEFAULT NULL COMMENT '玩具',
  `attr_dog` int(10) DEFAULT NULL COMMENT '狗',
  `attr_home` int(10) DEFAULT NULL COMMENT '家',
  `attr_public` int(10) DEFAULT NULL COMMENT '公众场合',
  `attr_heart` int(10) DEFAULT NULL COMMENT '精神',
  `attr_torture` int(10) DEFAULT NULL COMMENT '刑',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

